import React from "react";

const InfoCus = ({ customerId, email, phone }) => {
  return (
    <div>
      <h2>고객 정보</h2>
      <ul>
        <li>
          <strong>ID:</strong> {customerId}
        </li>
        <li>
          <strong>이메일:</strong> {email}
        </li>
        <li>
          <strong>전화번호:</strong> {phone}
        </li>
      </ul>
    </div>
  );
};

export default InfoCus;
